De Outubro de 1995 a Junho de 2001 - exerceu funções de assessora jurídica no Gabinete do Presidente da Assembleia da República.
Durante este período, suspendeu durante dois meses, as funções referidas para exercer o mandado de Deputada pelo 
pelo Partido Socialista eleita pelo círculo eleitoral de Coimbra;

Fundadora de:
- APAV;
- Liga dos Amigos do Hospital de S. Francisco Xavier;
- Associação Reintegrar;
- Associação de Psicogerontologia;
- Associada Honorária da Associação dos Profissionais das USF's

Membro da Delegação Portuguesa à Assembleia Parlamentar da NATO (1999 -2002);
Membro efectivo da Assembleia Parlamentar da União Interparlamentar (UIP -2007/2009);
Presidente da Assembleia Distrital do PSD de Santarém (2002/2009);

Membro Fundador da Plataforma de Reflexão Estratégica "Construir Ideias";
Conferências em Universidades e Institutos Politécnicos em matéria de Organização e Ordenamento do Território, Financiamento da Administração Local e Comunicação Política;
Director da revista "Templários - Turismo" (2001-2002);
Administrador Executivo da Fineterc;

Consultor da Euromedics;
Consultor da GIBB - Portugal;
Consultor da Sociedade Barrocas, Sarmento e Neves;
